private double getEuclideanDistance(double[] p1, double[] p2) {
    double sum = 0.0;
    for (int i = 0; i < p1.length; i++) {
        sum += Math.pow(p1[i] - p2[i], 2);
    }
    return Math.sqrt(sum);
}
